demo.repl.help:
دستیاب کمانڈز:
  @show              ─ آخری اڈاپٹو کارڈ کا خلاصہ دکھائیں
  @json              ─ فلو سے موصول ہونے والی خام JSON ویلیو دکھائیں
  @back              ─ پچھلے بلاک شدہ کارڈ/ان پٹس پر واپس جائیں
  @input <k>=<v>     ─ ان پٹ فیلڈ سیٹ کریں یا اووررائیڈ کریں
  @click <action_id> ─ فراہم کردہ ایکشن کے ساتھ کارڈ جمع کرائیں
  @help              ─ یہ مدد کا متن پرنٹ کریں
  @quit              ─ REPL سے باہر نکلیں
